eria and receive special payment.\\n\\nUnder current law, ambulance services furnished either by a CAH or by an entity owned or operated by a CAH are paid at a rate of 101% of reasonable costs incurred in furnishing those services, as long as the CAH or entity is the only provider of ambulance services that is located within a 35-mile drive of the CAH. The bill maintains this requirement but further requires that the CAH or entity furnishing the ambulance services be licensed or otherwise authorized to furnish services in the state in which the CAH is located.\"  },   \"titles\": [    {      \"as\": \"introduced\",       \"is_for_portion\": false,       \"title\": \"To amend title XVIII of the Social Security Act to modify requirements for payment under the Medicare program for ambulance services furnished by critical access hospitals, and for other purposes.\",       \"type\": \"official\"    },     {      \"as\": null,       \"is_for_portion\": false,       \"title\": \"To amend title XVIII of the Social Security Act to modify requirements for payment under the Medicare program for ambulance services furnished by critical access hospitals, and for other purposes.\",       \"type\": \"display\"    }  ],   \"updated_at\": \"2016-11-02T22:30:16Z\",   \"url\": \"https://www.gpo.gov/fdsys/bulkdata/BILLSTATUS/114/hr/BILLSTATUS-114hr3609.xml\"}",
