n of persons and property by air\\u00a0amounts paid by an aircraft owner or lessee for aircraft management services related to maintenance and support of the aircraft or flights on such aircraft.\\n\\nAircraft management services include assisting an aircraft owner with administrative and support services; obtaining insurance; maintenance, storage and fueling of aircraft; hiring, training, and provision of pilots and crew; establishing and complying with safety standards; or other services necessary to support flights operated by an aircraft owner.\\n\\nIn the case of an aircraft owner that is wholly-owned by another person, amounts paid by the other person on behalf of the aircraft owner must be treated as having been paid directly by the aircraft owner.\"  },   \"titles\": [    {      \"as\": \"introduced\",       \"is_for_portion\": false,       \"title\": \"To amend the Internal Revenue Code of 1986 to exempt amounts paid for aircraft management services from the excise taxes imposed on transportation by air.\",       \"type\": \"official\"    },     {      \"as\": null,       \"is_for_portion\": false,       \"title\": \"To amend the Internal Revenue Code of 1986 to exempt amounts paid for aircraft management services from the excise taxes imposed on transportation by air.\",       \"type\": \"display\"    }  ],   \"updated_at\": \"2016-11-14T15:01:09Z\",   \"url\": \"https://www.gpo.gov/fdsys/bulkdata/BILLSTATUS/114/hr/BILLSTATUS-114hr3608.xml\"}",
